import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import styles from './card.module.css'
import projectImage from '../images/projects/blistabloc.png'
import { projectsData } from '../data/Projects';

const useStyles = makeStyles({
  root: {
    maxWidth: 345,
  },
  media: {
    height: 140,
  },
});

export default function MediaCard(props) {
  const classes = useStyles();
    const projectData = props.projectData
  return (
<div className={styles.project_container}>
<div className={styles.project__pic}>
    <a href="#">
        <img src={projectImage} alt="project logo"/>
    </a>
</div>
<div className={styles.project_caption}>
        <div className={styles.project_name}>
          <a href="https://blistabloc.com/" target="_blank">{projectData.t}</a>
        </div>
        <p>Custom wordpress theme built with Timber and Woocommerce for blistabloc, the only reactive shoe insert that prevents
          blisters from forming.</p>
          <div>HGelll</div>
      </div>

</div>
  );
}
